import React, {Component} from 'react';
import { BrowserRouter as Router, Route, Link} from "react-router-dom"
import './Main.css'
import About from "./components/About";
import Rooms from "./components/Rooms";
import Contacts from "./components/Contacts"
import SignUp from "./components/signUp";
import ApplicationForm from "./components/ApplicationForm";

class App extends Component {

    state = {
        applicationFormVisible: false,
        userName: '',
        userLogin: ''
    };

    render() {
        return (
            <React.Fragment>
                <Router>

                    <header>
                        <div className='container'>
                            <div id='topPanel'>
                                <button id='logInBtn'>Войти</button>
                            </div>
                        </div>
                    </header>

                    <nav>
                        <img src='/src/resource/img/siburLogoTemp.png'/>
                        <ul id='mainNav'>
                            <li>
                                <Link to='/'>О сервисе</Link>
                            </li>
                            <li>
                                <Link to='/rooms'>Помещения</Link>
                            </li>
                            <li>
                                <Link to='/contacts'>Контакты</Link>
                            </li>
                            <li>
                                <Link to='/signup'>Регистрация</Link>
                            </li>
                            <li>
                                <button onClick={this.openApplicationForm}>Оформить заявку</button>
                            </li>
                        </ul>
                    </nav>

                    <section id='mainContent'>
                        <div className='container'>
                            <Route
                                path="/"
                                exact
                                render={(props) => <About applicationFormVisible={this.state.applicationFormVisible}/>}
                            />
                            <Route path="/rooms" component={Rooms}/>
                            <Route path="/contacts" component={Contacts}/>
                            <Route path="/signup" component={SignUp}/>
                        </div>
                    </section>

                </Router>
            </React.Fragment>
        );
    }

    openApplicationForm = () => {
        this.setState({
            applicationFormVisible: true
        })
    }
}

export default App;
